import RowTable from "../components#/row-table.vue";
import { columns } from "./shipments.config";
import { RowTableService } from "../components#/row-table.service";
import StoreDeliverGood from '@/views/biz-modals/store/deliver-good';
export default {
  name: 'shipments',
  components: {
    RowTable: RowTable
  },
  bem: {
    basic: 'page-order-shipments'
  },
  modals: {
    StoreDeliverGood: StoreDeliverGood
  },
  serviceInject: function serviceInject() {
    return {
      rowTableService: RowTableService
    };
  },
  methods: {
    // 获取发货订单列表
    getListData: function getListData(page) {
      if (page === 1) {
        this.$searchQuery.current_page = page;
      }

      this.rowTableService.getDeliverList(this.$searchQuery).subscribe();
    },
    sendGoods: function sendGoods(val) {
      var _this = this;

      this.$modalRouter.push({
        name: 'store-deliver-good',
        props: {
          id: val.id
        },
        on: {
          success: function success(res) {
            _this.getListData();
          }
        }
      });
    }
  },
  mounted: function mounted() {
    this.getListData();
  },
  computed: {
    columns: columns
  }
};
